import React from "react";
import API from "../utils/booksapi";

export default function BookSearch() {
  const searchBooks = () => {
    var search = document.getElementById("search").value;
    console.log(search);
    API.getBooks(search)
      .then((res) => {
        console.log(res);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  return (
    <div>
      <input type="text" id="search" placeholder="Title or Author"></input>
      <button onClick={searchBooks}>Search</button>
    </div>
  );
}
